const apellido = 'Carbajal';

//const nombreCompleto = nombre + ' ' + apellido;

const nombreCompleto = `
Hola
Mundo
${nombre}
${apellido}
                    dedede`;

console.log (nombreCompleto);

function getSaludo() {
    return 'Hola '+nombre;
}

console.log (`Esto es un saludo ${get}`);
